//bypasssing an object
const smallBox = <div style={{ width: 90, height: 90}}>small lightblue box</div>;
const mediumBox = <div style={{width: 180, height: 180}}>medium pink box</div>;
const largeBox = <div style={{width: 270, height: 270}}>large orange box</div>;


function App() {
    return (
        <div style={{}}>
            {smallBox}
            {mediumBox}
            {largeBox}
        </div>
    );
}

export default App;
